import { Link, useNavigate, useLocation } from "react-router-dom";
import { Button } from "@/components/ui/button";
import {
  DropdownMenu,
  DropdownMenuContent,
  DropdownMenuItem,
  DropdownMenuTrigger,
} from "@/components/ui/dropdown-menu";
import { LogOut, User } from "lucide-react";
import { useAuth } from "@/hooks/useAuth";

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { isAuthenticated, user, logout } = useAuth();

  const handleLogout = async () => {
    await logout();
    navigate("/login");
  };

  const isActive = (path: string) => {
    return location.pathname === path;
  };

  return (
    <header className="w-full border-b border-white/10 bg-nexus-dark/80 backdrop-blur-md sticky top-0 z-10">
      <div className="container mx-auto px-4 py-4 flex items-center justify-between">
        <Link to="/" className="flex items-center space-x-2">
          <img
            src="data:image/png;base64,"
            alt="Nexus Cripto Logo"
            className="h-12 w-auto"
          />
        </Link>

        {isAuthenticated ? (
          <div className="flex items-center space-x-6">
            <nav className="hidden md:flex items-center space-x-6">
              <Link
                to="/"
                className={`text-sm transition-colors hover:text-nexus-red ${
                  isActive("/")
                    ? "text-nexus-red font-medium"
                    : "text-nexus-light"
                }`}
              >
                Converso
              </Link>
              <Link
                to="/history"
                className={`text-sm transition-colors hover:text-nexus-red ${
                  isActive("/history")
                    ? "text-nexus-red font-medium"
                    : "text-nexus-light"
                }`}
              >
                Histrico
              </Link>
              <Link
                to="/favorites"
                className={`text-sm transition-colors hover:text-nexus-red ${
                  isActive("/favorites")
                    ? "text-nexus-red font-medium"
                    : "text-nexus-light"
                }`}
              >
                Favoritos
              </Link>
            </nav>

            <DropdownMenu>
              <DropdownMenuTrigger asChild>
                <Button
                  variant="ghost"
                  size="icon"
                  className="rounded-full h-8 w-8 bg-nexus-red/10 hover:bg-nexus-red/20"
                >
                  <User size={18} className="text-nexus-light" />
                </Button>
              </DropdownMenuTrigger>
              <DropdownMenuContent align="end">
                <DropdownMenuItem className="flex items-center gap-2 text-sm font-medium">
                  <User size={14} />
                  <span>{user?.email}</span>
                </DropdownMenuItem>
                <DropdownMenuItem
                  onClick={handleLogout}
                  className="text-destructive flex items-center gap-2 text-sm"
                >
                  <LogOut size={14} />
                  <span>Sair</span>
                </DropdownMenuItem>
              </DropdownMenuContent>
            </DropdownMenu>
          </div>
        ) : (
          <div className="flex items-center space-x-2">
            <Button variant="ghost" onClick={() => navigate("/login")}>
              Entrar
            </Button>
            <Button
              variant="default"
              onClick={() => navigate("/register")}
              className="bg-nexus-red hover:bg-nexus-red/90"
            >
              Registrar
            </Button>
          </div>
        )}
      </div>
    </header>
  );
};

export default Navbar;
